import React, { useEffect } from 'react';

const Bads1 = () => {
  useEffect(() => {
    const script = document.createElement('script');
    script.src = "https://pagead2.googlesyndication.com/pagead/js/adsbygoogle.js?client=ca-pub-7482778154397164";
    script.crossOrigin = "anonymous";
    script.async = true;

    document.head.appendChild(script);

    script.onload = () => {
      (window.adsbygoogle = window.adsbygoogle || []).push({});
    };

    return () => {
      document.head.removeChild(script);
    };
  }, []);

  return (
    <div>
      <ins className="adsbygoogle"
           style={{ display: 'block' }}
           data-ad-client="ca-pub-7482778154397164"
           data-ad-slot="3081667711"
           data-ad-format="auto" 
           data-full-width-responsive="true">
      </ins>
    </div>
  );
};

export default Bads1;
